function init(){for(var e=document.getElementsByTagName("img"),t=0;t<e.length;t++)if(e[t].getAttribute("data-src")){e[t].setAttribute("src",e[t].getAttribute("data-src"));e[t].getAttribute("data-src")}}function slideshow(){setInterval(function(){nextSlide("dti-ss")},2e3)}function nextSlide(e){var t=document.getElementById(e).getElementsByClassName("slide");t.index=t.index||0,t[t.index].className="slide",t.index=(t.index+1)%t.length,t[t.index].className="slide showing"}function collapsible(e,t,s){const i=document.getElementById(e).getElementsByClassName(t),l=document.getElementById(e).getElementsByClassName(s);for(let e=0;e<i.length;e++)i[e].addEventListener("click",function(){for(let e=0;e<l.length;e++)l[e].style.height="0px";if(this.classList.contains("active"))this.classList.remove("active");else{for(let e=0;e<i.length;e++)i[e].classList.remove("active");this.classList.toggle("active");var e=this.nextElementSibling;e.style.height=e.scrollHeight+"px"}})}init(),onload=slideshow,collapsible("headlines","collapsible","content");